en-US:
The package '{0}' is not found, required for the asset to work. To install the package:
1. Open the Unity Package Manager;
2. Click on the PLUS button in the upper left corner of the window;
3. Select 'Add package from git URL' menu item and enter the package name '{0}';
4. Click on the Install button;
5. The package is installed, now you can use the asset.

ja-JP:
アセットを動作させるために必要なパッケージ '{0}' が見つかりません。パッケージをインストールするには:
1. Unity Package Manager を開きます;
2. ウィンドウ左上の PLUS ボタンをクリックします;
3. 'Add package from git URL' メニュー項目を選択し、パッケージ名 '{0}' を入力します;
4. Install ボタンをクリックします;
5. パッケージがインストールされ、アセットを使用できるようになります。

