1. Unity 패키지 매니저를 엽니다;
2. 창 왼쪽 상단의 PLUS 버튼을 클릭합니다;
3. 'git URL에서 패키지 추가' 메뉴 항목을 선택하고 패키지 이름 '{0}'을（를） 입력합니다;
