en-US:
For some of your components ({0}), download links for images were not found. Possible reasons:
1. You are importing frames that have a large size in pixels. Try reducing the Image Scale in the Main Settings of the asset;
2. You need to reauthorize in your Figma account within the asset;
3. You have exceeded the request limit to the Figma API, and you need to wait some time before attempting another import;
4. Your component is hidden, has zero, or negative size.

If the advice from points 1, 2, or 3 did not help, please contact the developer.
Also, you can try using an asset for procedural image generation instead of the standard one, for example, the free Shapes2D asset. You can read more about this in the "Manual for developers" attached to the asset.

List of these components:
{1}

ja-JP:
一部のコンポーネント （{0}） に対し、画像のダウンロードリンクが見つかりませんでした。考えられる原因:
1. ピクセルサイズが大きいフレームをインポートしています。アセットのメイン設定で Image Scale を小さくしてみてください;
2. アセット内で Figma アカウントの再認証が必要です;
3. Figma API のリクエスト制限を超えており、再試行する前にしばらく待つ必要があります;
4. コンポーネントが非表示、またはゼロもしくは負のサイズになっています。

1, 2, 3 の対処法で解決しない場合は、開発者にお問い合わせください。
また、標準の代わりに手続き型の画像生成用アセット （例: 無料の Shapes2D アセット） を試すこともできます。詳細はアセットに添付の「開発者向けマニュアル」をご参照ください。

これらのコンポーネント一覧:
{1}

ko-KR:
일부 컴포넌트（{0}）에 대한 이미지 다운로드 링크를 찾을 수 없습니다. 가능한 이유:
1. 픽셀 크기가 큰 프레임을 가져오고 있습니다. 에셋 메인 설정에서 이미지 크기를 줄여 보세요;
2. 에셋 내에서 Figma 계정을 다시 인증해야 합니다;
3. Figma API 요청 한도를 초과했으므로 다시 가져오기 전에 잠시 기다려야 합니다;
4. 컴포넌트가 숨겨져 있거나 크기가 0 또는 음수입니다.

1, 2, 3번 조치가 도움이 되지 않는 경우 개발자에게 문의하세요.
또한 표준 에셋 대신 절차적 이미지 생성용 에셋을 사용할 수 있습니다. 예: 무료 Shapes2D 에셋. 이에 대한 자세한 내용은 에셋에 첨부된 "개발자 매뉴얼"에서 확인할 수 있습니다.

이 컴포넌트 목록:
{1}

es-ES:
Para algunos de tus componentes ({0}), no se encontraron enlaces de descarga de imágenes. Posibles razones:
1. Estás importando marcos que tienen un tamaño grande en píxeles. Intenta reducir la escala de imagen en la Configuración Principal del asset;
2. Debes volver a autorizar tu cuenta de Figma dentro del asset;
3. Has excedido el límite de solicitudes a la API de Figma y necesitas esperar un tiempo antes de intentar otra importación;
4. Tu componente está oculto, tiene tamaño cero o negativo.

Si los consejos de los puntos 1, 2 o 3 no ayudaron, por favor contacta al desarrollador.
También puedes intentar usar un asset de generación de imágenes procedimental en lugar del estándar, por ejemplo, el asset gratuito Shapes2D. Puedes leer más sobre esto en el "Manual para desarrolladores" adjunto al asset.

Lista de estos componentes:
{1}

de-DE:
Für einige Ihrer Komponenten ({0}) wurden keine Download-Links für Bilder gefunden. Mögliche Gründe:
1. Sie importieren Frames mit einer großen Pixelgröße. Versuchen Sie, den Image Scale in den Haupteinstellungen des Assets zu reduzieren;
2. Sie müssen sich in Ihrem Figma-Konto innerhalb des Assets erneut autorisieren;
3. Sie haben das Anfrage-Limit an die Figma API überschritten und müssen eine Weile warten, bevor Sie einen weiteren Import versuchen;
4. Ihre Komponente ist ausgeblendet, hat null oder negative Größe.

Wenn die Ratschläge aus den Punkten 1, 2 oder 3 nicht helfen, wenden Sie sich bitte an den Entwickler.
Sie können auch versuchen, ein Asset zur prozeduralen Bildgenerierung anstelle des Standard-Assets zu verwenden, zum Beispiel das kostenlose Shapes2D-Asset. Mehr dazu finden Sie im "Manual for developers", das dem Asset beiliegt.

Liste dieser Komponenten:
{1}

fr-FR:
Pour certains de vos composants ({0}), les liens de téléchargement des images n’ont pas été trouvés. Raisons possibles :
1. Vous importez des images avec une grande taille en pixels. Essayez de réduire l’échelle d’image dans les paramètres principaux de l’actif ;
2. Vous devez vous réauthentifier dans votre compte Figma au sein de l’actif ;
3. Vous avez dépassé la limite de requêtes vers l’API Figma et devez attendre un certain temps avant de réessayer ;
4. Votre composant est masqué, a une taille nulle ou négative.

Si les conseils des points 1, 2 ou 3 n’ont pas aidé, contactez le développeur.
Vous pouvez également essayer d’utiliser un actif de génération d’images procédurales plutôt que l’actif standard, par exemple l’actif gratuit Shapes2D. Vous trouverez plus d’informations à ce sujet dans le « Manuel pour développeurs » joint à l’actif.

Liste de ces composants :
{1}

